demo.repl.help:
Kullanılabilir komutlar:
  @show              ─ son uyarlanabilir kart özetini göster
  @json              ─ akıştan gelen ham JSON değerini yazdır
  @back              ─ önceki engellenmiş kart/girdilere dön
  @input <k>=<v>     ─ giriş alanını ayarla veya değiştir
  @click <action_id> ─ belirtilen eylemle kartı gönder
  @help              ─ bu yardım metnini yazdır
  @quit              ─ REPL'den çık
